import './App.css';
import { Router, Routes, Route } from 'react-router-dom';
import Home from './components/Home'

function App() {
  return (

    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>

  );

}

export default App;
